description:
The mischievous, barbarian chieftan, Randy Spears, and his hell-raising horde will stop at nothing to rend a powerful, magical crystal from the hands of its rightful owners in &quot;The New Barbarian&quot;, a very good, 1990 release from VCA and Henri Pachard. With its inexplicable ability to bring about time-travel, this sexually-fueled gem is certainly a prize worth seeking...and, for Victoria Paris and her peaceful people, a prize worth protecting. A blend of sex and (mild) violence ensues, as the two groups wrestle for control of the piece. Harking back to the days of the old barbarian films of the 1980s while concomitantly mixing in that same era's pornographic charm, this one is most certainly rife with nostalgic value. The sex is also steamy...again, in that 80s style...and seeing Victoria Paris sex it up in her prime is always a welcomed occurrence. For the right crowd--fans of 80s fantasy, porno nostalgia, Victoria Paris, and / or quirky features--this one is worthy.

